9339-4f87-8dd4-0f9fddc2cf64","trusted":true,"collapsed":false,"jupyter":{"outputs_hidden":false}}},{"cell_type":"code","source":"linear_interpolation <- function(data_vec, start_missing_indices, end_missing_indices){\n  missing_size = end_missing_indices - start_missing_indices + 1\n  slope = (data_vec[end_missing_indices+1]-data_vec[start_missing_indices-1])/(missing_size+1)\n  \n  filling_data = rep(NA, missing_size)\n  for (i in 1:missing_size){\n    filling_data[i] = data_vec[start_missing_indices-1] + slope * i\n  }\n  return(filling_data) \n}","metadata":{"_uuid":"36525b5d-5016-4991-9802-e24e5c44974e","_cell_guid":"8ea61ae3-28e4-43da-8660-ada553f70993","trusted":true,"collapsed":false,"execution":{"iopub.status.busy":"2025-03-21T02:03:33.041907Z","iopub.execute_input":"2025-03-21T02:03:33.043691Z","iopub.status.idle":"2025-03-21T02:03:33.057588Z","shell.execute_reply":"2025-03-21T02:03:33.055277Z"},"jupyter":{"outputs_hidden":false}},"outputs":[],"execution_count":36},{"cell_type":"code","source":"find_missing_index <- function(input_vec){\n  start_missing_index <- c()\n  end_missing_index <- c()\n  missing_values <- which(is.na(input_vec))\n  start_missing_index[1] <- missing_values[1]\n  \n  for (i in 2:(length(missing_values))){\n    if (missing_values[i]-missing_values[i-1] > 1){\n      start_missing_index <- c(start_missing_index, missing_values[i]) \n      end_missing_index <- c(end_missing_index, missing_values[i-1]) \n    }\n  }\n  end_missing_index <- c(end_missing_index, missing_values[length(missing_values)])\n  missing_period <- end_missing_index - start_missing_index + 1\n  \n  input_vec_missingness_index <- as.data.frame(cbind(start_missing_index, end_missing_index, missing_period))\n  return(input_vec_missingness_index)\n}","metadata":{"_uuid":"074666b9-1f86-4682-93c7-88c97958db22","_cell_guid":"31e5de92-7367-4fb0-b6ed-ddb4fbea43ef","trusted":true,"collapsed":false,"execution":{"iopub.status.busy":"2025-03-21T02:03:34.553789Z","iopub.execute_input":"2025-03-21T02:03:34.555573Z","iopub.status.idle":"2025-03-21T02:03:34.569056Z","shell.execute_reply":"2025-03-21T02:03:34.566987Z"},"jupyter":{"outputs_hidden":false}},"outputs":[],"execution_count":37},{"cell_type":"code","source":"linear_interpolation_df <- function(df, col_names, cut_off){\n  for (col_name in col_names){\n    input_vec <- df[[col_name]]\n    input_vec_missingness_index <- find_missing_index(input_vec)\n\n    for (i in 1:nrow(input_vec_missingness_index)){\n      if (input_vec_missingness_index$missing_period[i] <= cut_off){\n        start = input_vec_missingness_index$start_missing_index[i]\n        end = input_vec_missingness_index$end_missing_index[i]\n          \n        filling_gap <- linear_interpolation(data_vec = input_vec, \n                                            start_missing_indices = start, \n                                            end_missing_indices = end)  \n        input_vec[start:end] <- filling_gap\n        df[[col_name]] <- input_vec\n      } \n    }\n  }\n  return(df)\n}","metadata":{"_uuid":"f8dda80c-10fc-4f0a-98ed-94b4dfd2ab41","_cell_guid":"250c2c5c-5106-4fe2-9723-be37004ba105","trusted":true,"collapsed":false,"execution":{"iopub.status.busy":"2025-03-21T02:03:36.139092Z","iopub.execute_input":"2025-03-21T02:03:36.140829Z","iopub.status.idle":"2025-03-21T02:03:36.153319Z","shell.execute_reply":"2025-03-21T02:03:36.151425Z"},"jupyter":{"outputs_hidden":false}},"outputs":[],"execution_count":38},{"cell_type":"code","source":"length(which(is.na(yarmouth$avg_water_surge)))\nlength(which(is.na(yarmouth$avg_wind_speed)))\nlength(which(is.na(yarmouth$rain)))\nlength(which(is.na(yarmouth$avg_temperature)))","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-03-21T02:03:37.817848Z","iopub.execute_input":"2025-03-21T02:03:37.819541Z","iopub.status.idle":"2025-03-21T02:03:37.848131Z","shell.execute_reply":"2025-03-21T02:03:37.846477Z"}},"outputs":[{"output_type":"display_data","data":{"text/html":"5111","te